import {useForm} from 'react-hook-form'
import React from 'react'

const form = () => {
    const {
        register,
        handleSubmit,
        formState: { errors },
      } = useForm();

      return (
      <div>
        <form onSubmit={handleSubmit((data) => console.log(data))}>
          <label >Nombres</label>
          <input {...register('Name', {required: true})} />
          {errors.Name && <p>Last name is required.</p>}
          <label >Apellido Parterno</label>
          <input {...register('FirstLastName', { required: true })} />
          {errors.FirstLastName && <p>Last name is required.</p>}
          <label >Apellido Materno</label>
          <input {...register('SecondLastName')} />
          <label >Rut</label>
          <input {...register('Rut', { pattern: /\d+/ })} />
          {errors.age && <p>Please enter number for age.</p>}
          <input type="submit" />
        </form>
        </div>
      );
};
export default form;


